; // override this to adjust the position of the pointer\\n    }\\n  }\\n}\\n```\\n"]]],false],[0,"\\n\\n"],[6,"div"],[9,"style","padding-left: 100px"],[7],[0,"\\n  "],[1,[18,"embed-button"],false],[0,"\\n"],[8]],"hasEval":false}',meta:{moduleName:"dummy/templates/components/stories/embed-button.hbs"}})}),define("dummy/templates/components/stories/playlist-credit",["exports"],function(e){Object.defineProperty(e,"__esModule",{value:!0}),e.default=Ember.HTMLBars.template({id:"1kPwfcw7",block:'{"symbols":[],"statements":[[1,[25,"md-text",null,[["text"],["\\n#### `playlist-credit`\\nRenders a credit line for a music entry. Expects a `music entry` object as its `musicEntry` parameter.\\n\\n```hbs\\n{{playlist-credit story=story.playlist.[0]}}\\n```\\n"]]],false],[0,"\\n\\n"],[1,[25,"playlist-credit",null,[["musicEntry"],[[20,["model","item","playlist","0"]]]]],false],[0,"\\n"]],"hasEval":false}',meta:{moduleName:"dummy/templates/components/stories/playlist-credit.hbs"}})}),define("dummy/templates/components/stories/related-stories",["exports"],function(e){Object.defineProperty(e,"__esModule",{value:!0}),e.default=Ember.HTMLBars.template({id:"OFKqIif/",block:'{"symbols":[],"statements":[[1,[25,"md-text",null,[["text"],["\\n#### `related-stories`\\n\\nThe `related-stories` component takes a function that should run a query lookup on the store. The `related-stories` component will call this function and set its result as its `stories` property, which it will loop through and render out each item in a `story-tease` component.\\n\\nSo the function passed to `getStories` should look like:\\n"]]],false],[0,"\\n"],[1,[25,"code-snippet",null,[["name"],["get-related-stories.js"]]],false],[0,"\\n\\n"],[1,[25,"md-text",null,[["text"],["Assuming `RELATED_TO_ID` is set as:"]]],false],[0,"\\n"],[1,[25,"code-snippet",null,[["name"],["related-to.js"]]],false],[0,"\\n\\n"],[1,[25,"md-text",null,[["text"],["\\nYou can then render out a list of stories related to `RELATED_TO_ID` like so:\\n"]]],false],[0,"\\n"],[1,[25,"code-snippet",null,[["name"],["related-stories.hbs"]]],false],[0,"\\n\\n"],[1,[25,"related-stories",null,[["getStories"],[[20,["model","getRelatedStories"]]]]],false],[0,"\\n"]],"hasEval":false}',meta:{moduleName:"dummy/templates/components/stories/related-stories.hbs"}})}),define("dummy/templates/components/stories/story-comments",["exports"],function(e){Object.defineProperty(e,"__esModule",{value:!0}),e.default=Ember.HTMLBars.template({id:"M4l2xtdH",block:'{"symbols":[],"statements":[[1,[25,"md-text",null,[["text"],["\\n#### `story-comments`\\nStory comments require a story model to be passed in as the `story` param. There is a model function, `commentSecurityURL`, which the component runs in order to do some basic abuse prevention. This method will include the `browserId` in the request if it is passed in.\\n\\nThe `email` and `userName` params are not required, but can be passed in to autofill the fields if the values can be retrieved from an authenticated session.\\n\\nThe component expects a `getComments` parameter which must be a function that when run will do a query for comments associated with the current story. The comments query requires two parameters: `itemTypeId` and `itemId`, both of which are available from a given story at the keys used in the following example:\\n"]]],false],[0,"\\n"],[1,[25,"code-snippet",null,[["name"],["get-comments.js"]]],false],[0,"\\n\\n"],[1,[25,"md-text",null,[["text"],["\\nAnd let\'s imagine that there\'s a `realStory` attribute on the `model` that is the result of a backend lookup of an actual story. A list of comments for this given story would be rendered like the below. Please note that `isStaff` is set to true for example purposes.\\n"]]],false],[0,"\\n"],[1,[25,"code-snippet",null,[["name"],["story-comments.hbs"]]],false],[0,"\\n\\n"],[1,[25,"md-text",null,[["text"],["Click below to see the list of comments and reveal the comment submission form."]]],false],[0,"\\n"],[1,[25,"story-comme